import setTheme from "../../utils/Themes";
import RecommenderInput from "./RecommenderInput";


function Recommender() {

    useEffect(() => {
        setTheme('#38003c', '#9400D3')
    })

    const [ inputValues, setInputValues ] = useState([]);

    const sendDataToParent = (inputValues) => {
        setInputValues(inputValues);
    }

    const searchButtonClicked = () => {

    }

    const [ recommenderResults, setRecommenderResults ] = useState([]);

    return (
        <div id="recommender-main-container">
            <RecommenderInput sendDataToParent={sendDataToParent} searchButtonClicked={searchButtonClicked}/>
            <div id="recommender-results-container">
                <h3>RESULTS</h3>
                <div id="recommender-results">
                    {recommenderResults.map( player => {
                        return (
                            <p>{player.web_name}</p>
                        )
                    })}
                </div>
            </div>
        </div>
    )
}

function getRecommendations(inputValues) {
    const bank = inputValues[0]
    const nGKP = inputValues[1]
    const nDEF = inputValues[2]
    const nMID = inputValues[3]
    const nFWD = inputValues[4]
    const notInclude = inputValues[5]

}
	


export default Recommender;
